Tank on the Moon (ZED)

Science Documentary hosted by Patrick Floersheim, published by ZED in 2007 - English narration


Information
------------------------------

During the 1960s, the United States and the Soviet Union were engaged in a feverish competition to be the first to set foot on the moon. We know who won this race, but less about a secret chapter.
The Soviets may not have sent a man to the moon, but they successfully guided two small robots by remote control from the earth.
